const BioData = ({ person }) => {
  return (
    <div className="bg-slate-700 p-3 sm:w-2/3 m-3 rounded-md">
      <div className="flex items-center justify-between">
        <div className="">
          <h2 className="text-xl font-bold">{person.name}</h2>
          <h3 className="text-lg font-semibold">Front-End Developer</h3>
          <h3 className="mb-3">{person.address}</h3>
          <ul>
            <li>Phone: {person.contact.phone}</li>
          </ul>
        </div>
        <img
          src={person.image}
          alt="profilePic"
          className="w-40 rounded-lg object-cover shadow-xl shadow-slate-500/50"
        />
      </div>
    </div>
  );
};
export default BioData;
